import React from 'react';
import './Product.css';


const product = (props)=>{
    console.log(props.product["sfdcName"],props.product.sfdcName,props.product.compositeProducts[0].priceEntry.listPrice);
    return (
        <div className="card">
            <div className="productImage">
                {/* <img src={props.product.compositeProducts.EProductMedia.smallURI} alt=""/> */}
            </div>
            <span className="productName">{props.product.sfdcName}</span>
            <span className="productPrice">{props.product.compositeProducts[0].priceEntry.listPrice}</span> 
        </div>
    );
}
export default product;
